import React from 'react';

function Food({name}){
  return (<h1>I am a {name}</h1>);
}

const foodName = [
  {name: "kimchi"},
  {name: "ramyeon"},
  {name: "coffee"}
]

function renderFood(dish){
  console.log(dish);
  return <Food name = {dish.name} />
}

function App() {
  return (
    <div>
      {foodName.map(renderFood)}
    </div>
  );
}

export default App;
